		<script src="wasm_exec.js"></script>
		<script>
			const go = new Go();
            go.exit = (code) => {
                if (code !== 0) {
                    throw new Error("Go runtime exited abnormally with code " + code)
                }
            }
			WebAssembly.instantiateStreaming(fetch("app.wasm"), go.importObject).then((result) => {
				go.run(result.instance);
			});
		</script>
